import React, { useEffect } from 'react'

function Covid() {
    const getCovidData = () => {
        const res = fetch("https://api.covid19india.org/v4/min/data.min.json")
    }
    useEffect(() => {
        getCovidData();
    }, [])
    return (
        <div>
            Covid-19 updates
        </div>
    )
}

export default Covid;
